function renderTimeline() {
    if(this.activated) {
    if(this.zoomedOut) {
        this.renderZoomedOutTimeline();
        this.owner.get("zoomOut").setLabel("Zoom in");
    } else {
        this.renderNormalTimeline();
        this.owner.get("zoomOut").setLabel("Zoom out");
    }
    }

}

