3351.source:
function renderZoomedOutTimeline() {
    var parent = this.get("SeeTheState");

    this.timelineColumns = [];
    this.submorphs.invoke('remove');

    var table = jQuery("<table></table>");
    table.css("table-layout","fixed");
    table.css("border-collapse","collapse");
    table.css("width", "100%");
    table.css("height", "100%");
    for(var variableName in parent.timeline) {
        var rowData = parent.timeline[variableName];
        var rowMax = rowData.max();
        var rowMin = rowData.min();
        var tableRow = jQuery("<tr></tr>");
        tableRow.appendTo(table);
        for(var i = 0; i < rowData.length; i++) {
            var fillLevel;
            this.timelineColumns[i] = this.timelineColumns[i] || [];
            var cell = this.renderCell();
            cell.css("width", this.zoomedOutCellWidth() + "px");
            cell.css("padding", "0px");
            cell.css("vertical-align", "bottom");
            cell.attr("class", "timelineColumn" + String(i));

            cell.appendTo(tableRow);
            var cellText = "";
            if(rowData[i] == undefined) {
                fillLevel = jQuery("<div></div>");
                cell.append(fillLevel);
                fillLevel.css("background-color", "red");
                fillLevel.css("height", "100%");
                fillLevel.css("width", "10px");
            }
            else if(typeof(rowData[i]) == "number" || Object.isArray(rowData[i])) {
                var fill = rowData[i];
                if(Object.isArray(rowData[i])) {
                    fill = rowData[i].length;
                };
                fillLevel = jQuery("<div></div>");
                cell.append(fillLevel);
                fillLevel.css("background-color", "black");
                var height = Math.round(((fill - 0.9*rowMin) / rowMax) * 40);
                fillLevel.css("height", String(height) + "px");
                fillLevel.css("width", "10px");
            }
            else {
                cellText = String(rowData[i]);
                cell.text(cellText);
            }

            this.timelineColumns[i].push(cell);
        }

        cell = this.renderCell();
        cell.css("width", "40px");
        cell.text(variableName);
        cell.prependTo(tableRow);
    };

    var grid = new lively.morphic.HtmlWrapperMorph(pt(200,200));
    grid.setFill(Color.white);
    grid.asJQuery().append(table);
    this.addMorph(grid);
    parent.timelineGrid = grid.asJQuery();
    parent.timelineTable = table;

}

3355.source:
function renderNormalTimeline() {
    var parent = this.get("SeeTheState");

    this.timelineColumns = [];
    this.submorphs.invoke('remove');

    var table = jQuery("<table></table>");
    table.css("table-layout","fixed");
    table.css("border-collapse","collapse");
    table.css("width", "100%");
    table.css("height", "100%");
    for(var variableName in parent.timeline) {
        var rowData = parent.timeline[variableName];
        var tableRow = jQuery("<tr></tr>");
        tableRow.appendTo(table);
        for(var i = 0; i < rowData.length; i++) {
            this.timelineColumns[i] = this.timelineColumns[i] || [];
            var cell = this.renderCell();
            cell.css("width", this.normalCellWidth() + "px");
            cell.attr("class", "timelineColumn" + String(i));
            cell.appendTo(tableRow);
            var cellText = "";
            if(rowData[i] == undefined) {
                cellText = "";
            }
            else if(Object.isArray(rowData[i])) {
                cellText = String("Array " + String(rowData[i].length));
            }
            else {
                rowData[i].getName = rowData[i].getName || function() {return "";};
                cellText = String(rowData[i]);
            }
            cell.text(cellText);

            this.timelineColumns[i].push(cell);
        }

        cell = this.renderCell();
        cell.css("width", this.normalVariableCellWidth() + "px");
        cell.text(variableName);
        cell.prependTo(tableRow);
    };

    var grid = new lively.morphic.HtmlWrapperMorph(pt(200,200));
    grid.setFill(Color.white);
    grid.asJQuery().append(table);
    this.addMorph(grid);
    parent.timelineGrid = grid.asJQuery();
    parent.timelineTable = table;

}

3371.source:
function highlightColumn() {

    if(this.currentColumnNumber >= 0 && this.activated) {
    this.timelineColumns[this.previousColumnNumber].each(function(columnCell) {
            jQuery(columnCell).css("background-color", "white")
                                .css("color", "black");
    })
    this.timelineColumns[this.currentColumnNumber].each(function(columnCell) {
            jQuery(columnCell).css("background-color", "blue")
                                .css("color", "white");

    })

    if(this.currentColumnNumber > 0) {
        var leftOfCell = this.currentColumnNumber*(this.cellWidth() + this.cellBorderWidth()) 
                            + (this.variableCellWidth() + 1)
                            - 500;
        this.setAccumulatedScroll(leftOfCell, 0);
    } else if (this.currentColumnNumber == 0) {
        this.setAccumulatedScroll(0, 0);
    }
    }

}

