function onrestore() {
    module('lively.ast.Morphic').load(true)

    var self = this;
    cop.createLayer('LiveInterpreterLayer').refineObject(Global.lively.ast, {
        halt: function(frame) {
            self.setFrame(frame);
            return true
        }
    });

    cop.createLayer('IntelligentSlider').refineClass(lively.morphic.Slider, {
        onMouseUp : function(proceed, evt) {
            this.isBeingDragged = false;
            proceed(evt);
        },
        onMouseDown : function(proceed, evt) {
            this.isBeingDragged = true;  
            proceed(evt);  
        }
    });

}

