3833.source:
function onPrepare() {

    this.sliderStep = 3;
    this.maximumSteps = 0;
    this.environmentCache = [];
    this.timeline = {};
    this.oldStepsToRun = this.stepsToRun + 1; //resets the next steps leap length

    this.functionSource = "function(){\n"
                            + this.get("functionEditor").textString
                            + "\n}";
    this.functionToDisplay = Function.fromString(this.functionSource)
                                        .forInterpretation();

    var context = new lively.morphic.Text(pt(0,0).extent(pt(200,100)),"");

    var self = this;
    cop.withLayers([LiveInterpreterLayer], function() {
        try {
            self.functionToDisplay.startHalted().apply(context, []);
        } catch(e) {
            if (e.isUnwindException) {}
        };
    })

    this.writeCache(0, context, this.lastFrame);

    while(self.lastFrame.hasNextStatement()) {
        this.maximumSteps += 1;
        cop.withLayers([LiveInterpreterLayer], function() {
            try {
                self.lastFrame.stepToNextStatement();
            } catch(e) {
                if (e.isUnwindException) {}
            };
        })
        this.writeTimeline(this.maximumSteps, this.lastFrame);
        if(this.maximumSteps % this.cachePeriodLength() == 0) {
            this.writeCache(this.maximumSteps / this.cachePeriodLength(),
                            context,
                            this.lastFrame);
        }
    };



    // Restart the whole thing
    cop.withLayers([LiveInterpreterLayer], function() {
        try {
            self.functionToDisplay.startHalted().apply(context, []);
        } catch(e) {
            if (e.isUnwindException) {}
        };
    })

    this.get("timeline2").renderTimeline();

    //To display immediate effect.
    this.onRun();

}

3837.source:
function onRun() {
    var self = this;
    var context = this.get('contextOfFunction');

    this.get("timeline2").setColumnNumber(this.stepsToRun);
    this.get("timeline2").highlightColumn();

    // Code to optimize cache usage by minimizing cache usage
    var stepDifference = this.stepsToRun - this.oldStepsToRun;
    if(stepDifference < 0 || stepDifference > this.cachePeriodLength) {
        // We are going backwards so we have to restart the interpretation,
        // or we have made such a huge step, that it is probably faster
        // to load content from cache instead of recalculating it.
        context.submorphs.invoke('remove');

        cop.withLayers([LiveInterpreterLayer], function() {
            try {
                self.functionToDisplay.startHalted().apply(context, []);
                self.lastFrame.setThis(context);
            } catch(e) {
                if (e.isUnwindException) {}
            };
        })

        var executionPhase = Math.round((this.stepsToRun / this.cachePeriodLength()) - 0.5);
        this.readCacheInto(executionPhase, this.lastFrame, context);
        self.steps = executionPhase * this.cachePeriodLength();
    } else {
        // We only made a small leap forward and can just continue
        // running the interpretation.
        self.steps = self.oldStepsToRun;
    };


    while(this.steps < this.stepsToRun) {
        this.steps += 1;
        cop.withLayers([LiveInterpreterLayer], function() {
            try {
                lively.ast.doWithHalt(function() {
                    self.lastFrame.stepToNextStatement();
                });
            } catch(e) {
                if (e.isUnwindException) {}
            };
        })
    };

    // To enable this you have to add a textbox with
    // the name used in showItems
    // this.showItems();

    if(this.lastFrame) {
        this.highlightPosition(this.lastFrame.pc.pos);
    }
}

