3861.source:
function writeCache(step, context, frame) {

    var newMapping = frame.mapping;
    newMapping["_contextSubmorphs"] = [];
    newMapping["_contextSubmorphsPos"] = {};
    var ctx = context.submorphs.each(function(each) {
                newMapping["_contextSubmorphs"].push(each);
                newMapping["_contextSubmorphsPos"][each] = each._Position;
                });
    newMapping = this.valueCopy(frame.mapping);
    // add extra mapping variable for submorphs
    // copy everything in one pass
    // during reading call addMorph

    this.environmentCache[step] = {
        values : this.valueCopy(frame.values),
        context : ctx,
        pc : frame.pc,
        mapping : newMapping
    };

}

3865.source:
function readCacheInto(step, frame, context) {
    if(step < 0) {
        step = 0;
    }
    var env = this.environmentCache[step];
    frame.setPC(env["pc"]);
    frame.values = this.valueCopy(env["values"]);
    frame.mapping = this.valueCopy(env["mapping"]);
    frame.mapping["this"] = context;

   frame.mapping["_contextSubmorphs"].each(function(each) {
        context.addMorph(each);
        each.setPosition(env["mapping"]["_contextSubmorphsPos"][each]);
    });

}

3869.source:
function writeTimeline(step, frame) {

    for(var each in frame.mapping) {
        if(typeof(frame.mapping[each]) != "function" && each != "this"
            && each != "_contextSubmorphs" && each != "_contextSubmorphsPos") {
            this.timeline[each] = this.timeline[each] || [];
            this.timeline[each][step] = frame.mapping[each];
        }
    };

}

3873.source:
function onSliderMove(position) {
    this.sliderStep -= 1;
    this.sliderObjectGraphStep -= 1;
    var stepsSlider = this.get("stepsSlider");
    if(!stepsSlider.isBeingDragged && this.sliderStep <= 0) {
        this.oldStepsToRun = this.stepsToRun;
        this.stepsToRun = Math.round(this.maximumSteps * position);
        this.sliderStep = 2;

        this.smallSliderBaseStep = this.stepsToRun;
        this.get("smallStepsSlider").value = 0.5;
        this.onRun();
    };
}

3877.source:
function onSmallSliderMove(position) {
    this.sliderStep -= 1;
    this.sliderObjectGraphStep -= 1;

    var stepsSlider = this.get("smallStepsSlider");
    if(!stepsSlider.isBeingDragged && this.sliderStep <= 0) {
        this.oldStepsToRun = this.stepsToRun;
        this.stepsToRun = this.smallSliderBaseStep
                            + Math.round(50 * (position - 0.5));
        this.stepsToRun = this.stepsToRun < 0 ? 0 : this.stepsToRun;
        this.sliderStep = 2;
        this.onRun();
    };
}

3881.source:
function renderObjectGraph() {
    var variables = {};
    for(var k in this.lastFrame.mapping) {
        if(k != "this" && k != "self" && k != "_contextSubmorphs"
           && k != "_contextSubmorphsPos") {
            variables[k] = this.lastFrame.mapping[k];
        }
    };

    var sto = $morph("SeeTheObjects");
    if(sto) {
        sto.renderVariables(variables);
    };
}
